import React from 'react';

const WindowScoreBoard = () => {
    const instance = data.props;
    return (
        <div className="window-score-board">
            {/* Home Score */}
            <div className="home-score">
                {/* <h5>{instance.homeTeam}</h5>
                <h4 className="sb-score">{instance.homeScore}</h4> */}
                <p>Home score</p>
            </div>

            {/* Score Board */}
            <div className="clock">
                {/* <h5>{instance.time}</h5>
                <h4>QTR {instance.period}</h4> */}
                <p>clock</p>
            </div>

            {/* Away Score */}
            <div className="away-score">
                {/* <h5>{instance.awayTeam}</h5>
                <h4 className="sb-score">{instance.awayScore}</h4> */}
                <p>away score</p>
            </div>

        </div>
    )
}

export default WindowScoreBoard;
